script: |
  super -f text -I q8517.spq | sort > q8517.out

inputs:
  - name: q8517.spq
    data: |
      SELECT DISTINCT - 63 + - col1 + - 12 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL = - col2 + - + col1 + col2 * - ( + - 1 ) + - col1 * + CAST ( col0 AS INTEGER );
  - name: tab0

outputs:
  - name: q8517.out
    data: |
